    "Are you sure you want to restrict {email} access to \u201c{container}\u201d?": "\u0647\u0644 \u0623\u0646\u062a \u0645\u062a\u0623\u0643\u062f \u0645\u0646 \u0631\u063a\u0628\u062a\u0643 \u0641\u064a \u062a\u0642\u064a\u064a\u062f \u0648\u0635\u0648\u0644 {email} \u0625\u0644\u0649 \"{container}\"\u061f",
    "Are you sure you want to revert to the last published version of the unit? You cannot undo this action.": "B\u1ea1n ch\u1eafc ch\u1eafn mu\u1ed1n tr\u1edf l\u1ea1i phi\u00ean b\u1ea3n tr\u01b0\u1edbc c\u1ee7a b\u00e0i h\u1ecdc? B\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 ho\u00e0n t\u00e1c b\u01b0\u1edbc n\u00e0y.",
