    "Image must be in PNG format.": "\u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0627\u0644\u0635\u0648\u0631\u0629 \u0628\u0635\u064a\u063a\u0629 PNG.",
