    "Import YouTube Transcript": "\u0627\u0633\u062a\u064a\u0631\u0627\u062f \u0646\u0635 \u0645\u0646 \u064a\u0648\u062a\u064a\u0648\u0628",
    "In Progress": "\u0642\u064a\u062f \u0627\u0644\u0645\u0639\u0627\u0644\u062c\u0629",
    "In order to sign in, you need to activate your account.{line_break}{line_break}We just sent an activation link to {strong_start} {email} {strong_end}. If  you do not receive an email, check your spam folders or  {anchorStart}contact {platform_name} Support{anchorEnd}.": "\u0110\u1ec3 \u0111\u0103ng nh\u1eadp, b\u1ea1n c\u1ea7n k\u00edch ho\u1ea1t account.{line_break}{line_break}We v\u1eeba g\u1eedi m\u1ed9t li\u00ean k\u1ebft k\u00edch ho\u1ea1t t\u1edbi {strong_start} {email} {strong_end}. N\u1ebfu b\u1ea1n kh\u00f4ng nh\u1eadn \u0111\u01b0\u1ee3c email, h\u00e3y ki\u1ec3m tra c\u00e1c th\u01b0 m\u1ee5c spam c\u1ee7a b\u1ea1n ho\u1eb7c {anchorStart}contact {platform_name} Support{anchorEnd}.",
    "In the {linkStart}Course Outline{linkEnd}, use this group to control access to a component.": "Trong {linkStart}\u0110\u1ec1 c\u01b0\u01a1ng Kh\u00f3a h\u1ecdc{linkEnd}, s\u1eed d\u1ee5ng nh\u00f3m n\u00e0y \u0111\u1ec3 ki\u1ec3m so\u00e1t truy c\u1eadp v\u00e0o m\u1ed9t th\u00e0nh ph\u1ea7n.",
